import React, {PureComponent} from 'react';
import PropTypes from 'prop-types';

class Tabs extends PureComponent {
    render() {
        return (
            <div className={"tabs"}>
                <h1>Dine in</h1>
            </div>
        );
    }
}

Tabs.propTypes = {};

export default Tabs;
